            <p>チャットしてく？？</p>
        </div>
        <SignInArea />
        <style jsx>{`
            .page {
                width: 100%;
                max-width: 1280px;
                display: flex;
            }
            .ImageArea {
                width: 860px;
                height: 100%;
                position: rerative;
